import React from "react";
import { logout } from "../actions/currentAccount";
import { connect } from "react-redux";
import { Link } from "react-router-dom";
import M from "materialize-css";

const Navbar = (props) => {
  const logoutRedirect = () => {
    props.logout();
  };

  const render = () => {
    if (props.loggedIn && props.currentAccount.account.action) {

      return (
        <nav>
          <Link to="/" className="brand-logo left">
            FoodTrucks
          </Link>
          <ul id="nav-mobile" className="right hide-on-med-and-down">
            <a className="sidenav-trigger">
              <i className="material-icons">menu</i>
            </a>
            <li>
              <Link
                to={`/accounts/${props.currentAccount.account.action.id}/foodtrucks/new`}
              >
                New Foodtruck
              </Link>
            </li>
            <li>
              <Link to={`/accounts/${props.currentAccount.account.action.id}`}>
                My Foodtrucks
              </Link>
            </li>
            <li onClick={logoutRedirect}>
              <Link to="/logout">Log out</Link>
            </li>
          </ul>
          <ul className="sidenav" id="mobile-demo">
            <li>
              <a href="sass.html">Sass</a>
            </li>
            <li>
              <a href="badges.html">Components</a>
            </li>
            <li>
              <a href="collapsible.html">Javascript</a>
            </li>
            <li>
              <a href="mobile.html">Mobile</a>
            </li>
          </ul>
        </nav>
      );
    } else {
      return (
        <div>
          <div className="nav-wrapper ">
            <ul id="nav-mobile" className="right center-on-med-and-down">
              <li>
                <Link to="/signup">Sign Up</Link>
              </li>
              <li>
                <Link to="/login">Login</Link>
              </li>
            </ul>
          </div>
        </div>
      );
    }
  };
  return <div className="navbar-container indigo">{render()}</div>;
};
const mapStateToProps = (state) => {
  return {
    currentAccount: state.currentAccount,
    loggedIn: !!state.currentAccount,
  };
};
export default connect(mapStateToProps, { logout })(Navbar);
